import React, { useState } from 'react'
import { useHistory } from 'react-router-dom'
import axios from 'axios';

import { Helmet } from 'react-helmet'

import Navbar from '../components/navbar'
import SearchResult from './search-result';
import './home.css'


const [tracks, setTracks] = useState([]);
const [search, setSearch] = useState('');
const [query, setQuery] = useState('');
const [isLoading, setIsLoading] = useState(false);
useEffect(() =>
{
  Home();

}, [query]);

const Home = async () => {
  setIsLoading(true);
  const response = await fetch(`http://localhost:3000/api/track/${query}`);
  const data = await response.json();
  setTracks(data.data)
  console.log(data);
  setIsLoading(false);

  const updateSearch = e =>{
  setSearch(e.target.value);
    console.log(search);
  }

const getSearch =e =>{
  e.preventDefault();
  setQuery(search);
  setSearch('');
}

  return (
    <div className="home-container">
      <Helmet>
        <title>Deezer</title>
        <meta property="og:title" content="Deezer" />
      </Helmet>
      <Navbar rootClassName="navbar-root-class-name"></Navbar>
      <section className="home-section">
        <div className="home-hero">
          <div className="home-content">
            <main className="home-main">
              <header className="home-header">
                <h1 className="home-heading">Search for music</h1>
              </header>
              <div className="home-container1">
                <form onSubmit={getSearch} className='search-form'>
                 <input className='home-textinput input' type='text' value={search} onChange={updateSearch} placeholder="Search Tracks on Deezer"/>
                    <button className='home-get-started button' type='submit'><span className="home-text">
                    <span>Search</span>
                    <br></br>
                  </span></button>
             </form>


              </div>

            </main>
            {query==='' ? (
            <div className="home-highlight">
              <div className="home-avatars">
                <img
                  alt="image"
                  src="https://images.unsplash.com/photo-1552234994-66ba234fd567?ixid=Mnw5MTMyMXwwfDF8c2VhcmNofDN8fHBvdHJhaXR8ZW58MHx8fHwxNjY3MjQ0ODcx&amp;ixlib=rb-4.0.3&amp;w=200"
                  className="home-image avatar"
                />
                <img
                  alt="image"
                  src="https://images.unsplash.com/photo-1610276198568-eb6d0ff53e48?ixid=Mnw5MTMyMXwwfDF8c2VhcmNofDF8fHBvdHJhaXR8ZW58MHx8fHwxNjY3MjQ0ODcx&amp;ixlib=rb-4.0.3&amp;w=200"
                  className="home-image1 avatar"
                />
                <img
                  alt="image"
                  src="https://images.unsplash.com/photo-1618151313441-bc79b11e5090?ixid=Mnw5MTMyMXwwfDF8c2VhcmNofDEzfHxwb3RyYWl0fGVufDB8fHx8MTY2NzI0NDg3MQ&amp;ixlib=rb-4.0.3&amp;w=200"
                  className="home-image2 avatar"
                />
              </div>
              <label className="home-caption">
                Loved by 10,000+ people like you.
              </label>
              </div>
            ) : (isLoading ? (
                <div className="home-highlight"><p>Loading ..</p></div>
              ) : (<div className='recipes'>
          {tracks.map((track, index) =>(
            <SearchResult 
            key={index}

            image={track.data.album.cover_small} 
            artist_name={track.data.artist.name}
           track_title={track.data.title}
           track_duration={track.data.tra}
           />


          ))}


          </div>

        ))}
          </div>
          <div className="home-image3">
            <img
              alt="image"
              src="/SectionImages/mic-removebg-preview-600h.png"
              className="home-image4"
            />
          </div>
          <div className="home-image5"></div>
        </div>
      </section>
    </div>
  )
}

export default Home
